name: ConnectionStringType
fullName: azure.mgmt.oracledatabase.models.ConnectionStringType
module: azure.mgmt.oracledatabase.models
inheritances:
- azure.mgmt.oracledatabase._serialization.Model
summary: Connection strings to connect to an Oracle Autonomous Database.
constructor:
  syntax: 'ConnectionStringType(*, all_connection_strings: _models.AllConnectionStringType
    | None = None, dedicated: str | None = None, high: str | None = None, low: str
    | None = None, medium: str | None = None, profiles: List[_models.ProfileType]
    | None = None, **kwargs: Any)'
  keywordOnlyParameters:
  - name: all_connection_strings
    description: 'Returns all connection strings that can be used to connect to

      the Autonomous Database.'
    types:
    - <xref:azure.mgmt.oracledatabase.models.AllConnectionStringType>
  - name: dedicated
    description: 'The database service provides the least level of resources to each
      SQL

      statement, but supports the most number of concurrent SQL statements.'
    types:
    - <xref:str>
  - name: high
    description: 'The High database service provides the highest level of resources
      to each SQL

      statement resulting in the highest performance, but supports the fewest number
      of concurrent

      SQL statements.'
    types:
    - <xref:str>
  - name: low
    description: 'The Low database service provides the least level of resources to
      each SQL

      statement, but supports the most number of concurrent SQL statements.'
    types:
    - <xref:str>
  - name: medium
    description: 'The Medium database service provides a lower level of resources
      to each SQL

      statement potentially resulting a lower level of performance, but supports more
      concurrent SQL

      statements.'
    types:
    - <xref:str>
  - name: profiles
    description: 'A list of connection string profiles to allow clients to group,
      filter and

      select connection string values based on structured metadata.'
    types:
    - <xref:list>[<xref:azure.mgmt.oracledatabase.models.ProfileType>]
